#NFTCommunity #opensea #singer #British #SuperStar #itvnews https://t.co/R9BPeYYUsZ

@JLeslieMonique When a sample is cleared, there are two sets of copyrights that must be cleared: The sound recording copyright *and the music publishing copyright. 

The sound recording wasn’t sampled; no need to clear it.
But the music publishing copyright still must be cleared in *this case.

@PeloniMaria The occasion and the music is very powerful 

Committed this sound recording to my history today.

I am a little speechless

